import "./styles.css";
import React, { Component } from "react";
import {
  AiOutlineCheckSquare,
  AiOutlineSkin,
  AiOutlineBook,
} from "react-icons/ai";

export class SideNavigationMenu extends Component {
  render() {
    return (
      <div className="sideNavigationMenuContainer">
        Вкладки
        {typesData.map((item) => (
          <div className="sideNavigationMenuItemContainer" key={item.key}>
            <AiOutlineCheckSquare />
            {item.value}
          </div>
        ))}
      </div>
    );
  }
}

const typesData = [
  { key: 0, value: "Все", AiOutlineCheckSquare },
  { key: 1, value: "Личное", icon: AiOutlineSkin },
  { key: 2, value: "Работа", icon: "&#128188;" },
  { key: 3, value: "Учеба", icon: AiOutlineBook },
  { key: 4, value: "Отдых", icon: "&#9749;" },
];

export default SideNavigationMenu;
